import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p>Связаться с нами: <Link to="mailto:your-email@example.com">your-email@example.com</Link></p>
        <p>© Dom {new Date().getFullYear()}</p>
        <p>Operated by Eastwest Commercial Pte. Ltd.</p>
      </div>
    </footer>
  );
}

export default Footer;
